INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (133701, 61, 3, 5.18, 1020101, "2030/01/01 14:59:59", -6.0, "2025/01/31 12:00:00", 10201, "ラビリスタ", -285.0, 101, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 7);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (133901, 61, 1, 8.77, 1020102, "2030/01/01 14:59:59", -2.0, "2025/01/31 12:00:00", 10201, "クリスティーナ", -285.0, 201, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 2);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (133801, 61, 6, 15.5, 1020103, "2030/01/01 14:59:59", 0.0, "2025/01/31 12:00:00", 10201, "ネネカ", -285.0, 301, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 1);
